import React from "react";

const CourseRow = ({ course }) => (
  <div class="row border justify-content-between">
    <div class="col-6">
      <i class="far fa-file-alt" />
      <a >
        {this.course.name}
      </a>
    </div>
    <div class="d-none d-sm-block col-2 text-center">{this.course.owner}</div>
    <div class="d-none d-sm-block col-2 text-center">{this.course.modifiedDate}</div>
    <div class="col-2 text-right">X</div>
  </div>
);

export default CourseRow;
